import React, { Component } from 'react';

class Home extends Component{
    constructor(){
        super()
        this.state={
            items:[]
        }
    }
    render(){
        return(
            <div className="App">
            <h1>Inicio</h1>
            </div>
        );
    }
}
export default Home;
